    public ClothesNames()
    {

    }
    public string GetName(bool isProp, int ItemID, int DrawableID, int TextureID, string Gender)
    {
        FashionItemLookup di = FashionItemLookups.FirstOrDefault(x => x.IsProp == isProp && x.ItemID == ItemID && x.DrawableID == DrawableID && x.TextureID == TextureID && (x.Gender == Gender || x.Gender == "U"));
        if (di == null)
        {
            return "";
        }
        else if (di.Name == "NULL")
        {
            return "";
        }
        return di.Name;
    }
